The issue appears when we set $location.search() with some object and after that change this object's properties, like that:
```javascript
var obj = {foo: 'bar'};
$location.search(obj); // now url is set to '#?foo=bar'
obj.foo = 'boo';
var currentUrlObj = $location.search();
// current location is still '#?foo=bar' 
// while currentUrlObj is telling that current url object is {foo: 'boo'}
// which isn't correct
```
There's a little demo onJSBin:
http://jsbin.com/rekana/5/edit?js,output
And another JSBin with behaviour fixed on consumer's side:
http://jsbin.com/rekana/1/edit?js,output
I'm sure it's a bad idea to make someone think of that on the consumer's side.

Providers are used in config blocks, but in case when config block invokes before provider, there is no-provider error. This situation may appear when module and config block declared in one file, and provider - in another. Eg.

_module.js_
```
angular.module("App", [])

.config(function (fooProvider) {});
```

_foo-provider.js_
```
function fooProvider () {
  return {
    $get: function () {}
  };
}

angular.module("App")
.provider("foo", fooProvider);
```

Code from _module.js_ always runs first and causes an error. There is [fiddle](http://jsfiddle.net/garmashnikolay/9p5cgde4/1/)
What do you think?
